import React from "react";
import { Text, StyleSheet, View} from "react-native";



const BoxScreen = () => {
        
console.log('hello');
    return( 
    
    <View styles = {styles.viewStyle}>
        <Text styles = {styles.textStyle}>Box screen</Text>
        
        
    </View>
    
    );


};

const styles = StyleSheet.create({

    viewStyle: {

        borderWidth: 3,
        borderColor: 'black'

    },

    textStyle: {

        
        borderWidth: 1,
        borderColor: 'red',
        margin: 20
    }



}) ;


export default BoxScreen;
